// JavaScript Document
import React from 'react';
import State_Activities from '../pages/State_Activities';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";

//Smart Component
class State_Parks extends React.Component {
	//declaring state and new object
	state ={
		parkListing: [],
	}

//calling fetchData function
	componentDidMount(){
	this.fetchParks();
}

//fetching API
 fetchParks(){

	//state= x;

	fetch('https://developer.nps.gov/api/v1/parks?statecode=FL&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}).then(data =>{

		let pList = data.data.map((use)=>{
			return(

			  <li key={this.props.id}>
				<span key={use.results}>  
     <Typography variant="body" align="left">
      	<Link color="inherit" href="/">
		<img src={use.images[0].url} alt={use.images[0].altText} width="275" height="175"/><br />
		{use.fullName}
</Link>{' '}
</Typography>
				</span>
				</li>
			)
		})

		this.setState({State_Parks:pList});
	})
}
	 render() { 
  return (
  <Grid container style={styles.container}>

	  <Grid item xs={12} md={3} style={styles.links}>
	  <State_Activities />
	   </Grid>

	  <Grid item xs={12} md={8} style={styles.links}>
	  <Grid container style={styles.parks}>
	  <Grid item xs={12} md={2} style={styles.links}>
	  <Link />
	   </Grid>
	  </Grid>
	  </Grid>

	  {this.state.State_Parks}		
	  </Grid>
  );
 }
}
export default State_Parks

const styles ={
	container:{
		marginTop:'1%',
		border:'1px solid red',
		padding:'2%'
	},
	parks:{
		padding:'3%',
		border:'1px solid green',
	},
}
